import React from "react";
import ReactDOM from "react-dom/client";
import "./core.css";
import "./demo.css";
import "./theme-default.css";
import "./aseel.css";

import App from "./App";
import "bootstrap/dist/css/bootstrap.min.css";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
